import React from "react";
import {main} from "../images/main.jpg"

function Carousel () {
return(
    <div className='homeContainer'>
                <div className='carouselWrapper' id='carousel_1'>
                <img src={main} alt="carousel_images" className='carouselImage'/>
                <div className='carouselText'>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Minima quisquam nam debitis, nisi, enim vel iste quas est<span className='letter'></span></div>
                </div>
    </div>
)

}

export default Carousel;
